import React from "react";
import styles from "./Home.module.scss";
import TextField from "@mui/material/TextField";
// import Stack from "@mui/material/Stack";
// import Autocomplete from "@mui/material/Autocomplete";
import ContainerPNG from "../../components/assets/TopContainer.png";
import LeftIMGMidSection from "../../components/assets/img3.png";
import MidIMGMidSection from "../../components/assets/img4.png";
import RightIMGMidSection from "../../components/assets/img5.png";

export default function Home() {
  return (
    <div className={styles.body}>
      <div className={styles.topSections}>
        <div>
          <h1>Crafted Recipe, Fresh Ingredients</h1>
          <p>We deliver what you need to cook!</p>
        </div>
        <div className={styles.ContainerPNG}>
          <img src={ContainerPNG} alt='' />
        </div>
        <div className={styles.Containertext}>
          <Stack spacing={2} sx={{ width: 300 }}>
            <Autocomplete
              id='free-solo-demo'
              freeSolo
              options={top100Films.map((option) => option.title)}
              renderInput={(params) => (
                <TextField {...params} label='freeSolo' />
              )}
            />
            <Autocomplete
              freeSolo
              id='free-solo-2-demo'
              disableClearable
              options={top100Films.map((option) => option.title)}
              renderInput={(params) => (
                <TextField
                  {...params}
                  label='Search input'
                  InputProps={{
                    ...params.InputProps,
                    type: "search",
                  }}
                />
              )}
            />
          </Stack>
        </div>
      </div>
      <div className={styles.midSections}>
        <div className={styles.ImageContainer}>
          <div className={styles.ContainerIMG}>
            <img className={styles.Image} src={LeftIMGMidSection} alt='' />
            <img className={styles.Image} src={MidIMGMidSection} alt='' />
            <img className={styles.Image} src={RightIMGMidSection} alt='' />
          </div>
          <h1>Crafted Recipe, Fresh Ingredients</h1>
          {/* <div className={styles.ContainerIMG}>
          </div>
          <div className={styles.ContainerIMG}>
          </div> */}
        </div>
      </div>
      <div className={styles.botSections}>
        <h1>Featured in</h1>
      </div>
    </div>
  );
}
